import { useCallback } from "react";

function add(a, b) {
  return a + b;
}

export function CustomHookChildOne({ a, b }) {
  const memoizedCallback = useCallback(() => {
    return add(a, b);
  }, [a, b]);

  return <p>{memoizedCallback()}</p>;
}

export default function CustomHookParent() {
  return (
    <div>
      <CustomHookChildOne a="1" b="2" />
    </div>
  );
}
